import React, { Component } from 'react';
import './style.css';
import Job from './job';

class Work extends Component{
   constructor(){
    super()
    this.state={
        job:[
            {
                img_url:"https://cdn-icons-png.flaticon.com/512/5024/5024467.png",
                name:"MOBILE UX"
            },
            {
                img_url:"https://cdn-icons-png.flaticon.com/512/3159/3159310.png",
                name:"WEB DESIGN"
            }
        ]
    }
   } 
   render(){
    return(
        <React.Fragment>
        
    <div id='work_container'>
          <h1>  MY WORK</h1> 
        <Job name="MOBILE UX" img_url="https://cdn-icons-png.flaticon.com/512/5024/5024467.png" />
        <Job name="WEB DESIGN" img_url="https://cdn-icons-png.flaticon.com/512/3159/3159310.png"/>
        <Job name="HTML TEMPLATES" img_url="https://cdn-icons-png.flaticon.com/512/13/13706.png"/> 
    </div>
    </React.Fragment>
        
 
    )
   }
}
export default Work;
